mongoDB find, update and pull in One Query<p>I want to do all the find the data from the collection and then want to update some field as well as depending on want to empty the array.</p>

<pre><code>const addCityFilter = (req, res) =&gt; {
  if (req.body.aCities === "") {
    res.status(409).jsonp({ message: adminMessages.err_fill_val_properly });
    return false;
  } else {
    var Cities = req.body.aCities.split(","); // It will make array of Cities
    const filterType = { "geoGraphicalFilter.filterType": "cities", "geoGraphicalFilter.countries": [], "geoGraphicalFilter.aCoordinates": [] };
    /** While using $addToset it ensure that to not add Duplicate Value
     * $each will add all values in array
     */
    huntingModel
      .update(
        {
          _id: req.body.id,
        },
        {
          $addToSet: {
            "geoGraphicalFilter.cities": { $each: Cities }
          }
        },
        {$set:{filterType}},
      ).then(function(data) {
        res.status(200).jsonp({
          message: adminMessages.succ_cityFilter_added
        });
      });
  }
};
</code></pre>

<p><strong>Collection</strong></p>

<pre><code>geoGraphicalFilter: {
    filterType: {
      type:String,
      enum: ["countries", "cities", "polygons"],
      default: "countries"
    },
    countries: { type: Array },
    cities: { type: Array },
    aCoordinates: [
      {
        polygons: { type: Array }
      }
    ]
  }
</code></pre>

<p>But as result, the only city array is getting an update. No changes in <code>filterType</code>. </p>

