Mongoose doesn't catch errors after saving: TypeError: Cannot read property 'catch' of undefined<p>I was using Mongoose <code>4.13.11</code> and my code was working as expected but as soon as I upgraded to <code>5.0.15</code> I started to have the following error <code>TypeError: Cannot read property 'catch' of undefined</code> when I try to save my object and an error is found.</p>

<p>I've read around the issue seems to be that the <code>Save()</code> function does not return a <code>Promise</code>, I am using <code>bluebird</code> and everything was working fine on the previous <code>Mongoose</code> version <code>4.13.11</code></p>

<p>What am i missing or doing wrong because the <code>.catch()</code> should work as implemented.</p>

<p><strong>app.ts</strong></p>

<pre><code>mongoose.Promise = bluebird;
mongoose.connect(mongoUrl).then(
  () =&gt; { /** ready to use. The `mongoose.connect()` promise resolves to undefined. */ },
).catch(err =&gt; {
  console.log("MongoDB connection error. Please make sure MongoDB is running. " + err);
  // process.exit();
});
</code></pre>

<p><strong>Home.ts</strong></p>

<pre><code>let user: userInterface = {
        email: "foo@bar.com",
        firstName: "Brian",
        lastName: "Love",
        password: "as",
        role: 1,
        accountType: 1
    };

    var newUser = new User(user);      // create a new instance of the User model

    // save the newUser and check for errors
    var a=  newUser.save(function(err) {
        if (err){
            return err;
        }
        res.json({ message: 'User created!' });
    }).catch(function (error) {
        console.log(error);
    });
</code></pre>

